      out.write("                  <p  class=\"textoModal\">Nesse contexto, algumas opÃ§Ãµes de investimentos para jovens que podem entrar em sua carteira de aplicaÃ§Ãµes sÃ£o:</p>\r\n");
      out.write("                  <h2 class=\"tituloTextoModal\">Certificado de DepÃ³sito BancÃ¡rio (CDB)</h2>\r\n");
      out.write("                  <p  class=\"textoModal\">O CDB nada mais Ã© que um tÃ­tulo emitido pelos bancos que tem por objetivo levantar capital para financiar atividades de crÃ©dito â ou seja, o investidor recebe rentabilidade diÃ¡ria por um tipo de emprÃ©stimo Ã  instituiÃ§Ã£o financeira. Existem trÃªs tipos de certificados:</p>\r\n");
      out.write("                  <p  class=\"textoModal\">- no CDB prÃ©-fixado, os juros sÃ£o negociados no momento do investimento; - no CDB pÃ³s-fixado, os juros sÃ£o baseados em taxas de referÃªncia, normalmente a taxa Selic; - na terceira modalidade, os juros acompanham a inflaÃ§Ã£o.</p>\r\n");
      out.write("                  <p  class=\"textoModal\">Considerado como um investimento de baixo risco, ele ainda oferece a vantagem de incidÃªncia regressiva do imposto de renda: quanto maior o tempo de aplicaÃ§Ã£o, menor a tarifaÃ§Ã£o cobrada no resgate. O valor mÃ­nimo para investir no CDB gira em torno de 500 reais.</p>\r\n");
      out.write("                  <h2 class=\"tituloTextoModal\">Fundos de Investimento</h2>\r\n");
      out.write("                  <p  class=\"textoModal\">Uma opÃ§Ã£o que se destaca entre os investimentos para jovens, essa aplicaÃ§Ã£o oferece Ã³tima rentabilidade em longo prazo, e por isso pode ser uma boa escolha para a realizaÃ§Ã£o de um sonho de consumo, por exemplo. </p>\r\n");
      out.write("                  <p  class=\"textoModal\">AlÃ©m disso, as melhores aplicaÃ§Ãµes sÃ£o escolhidas a dedo pelo banco ou instituiÃ§Ã£o financeira contratada, tirando do investidor a responsabilidade de investigar as diversas opÃ§Ãµes disponÃ­veis no mercado na hora de decidir para onde vai seu dinheiro.</p>\r\n");
