      out.write("                  <p  class=\"textoModal\">Apesar da baixa rentabilidade (abaixo de praticamente todos os outros tipos de investimento), a poupanÃ§a oferece isenÃ§Ã£o da incidÃªncia de taxas, inclusive o imposto de renda, e alta liquidez â o dinheiro pode ser resgatado a qualquer momento.</p>\r\n");
